// Home.js
import React from 'react';
import pic from './assets/cat.jpeg';
import styled from 'styled-components';

const PageContainer = styled.div`
  height: calc(100vh - 78px);
  display: flex;
  align-items: center;
  justify-content: center;
`;

const HomeContainer = styled.div`
  display: flex;
  flex-wrap: wrap; /* Allow containers to wrap onto a new line */
  height: 80vh; /* Around 80% of the viewport height */
  width: 90%;
`;

const InfoContainer = styled.div`
  background-color: #f2f2f2;
  border-radius: 10px;
  padding: 20px;
  text-align: center;
  margin-bottom: 20px;
  width: 100%; /* Full width for small screens */
  max-width: 100%; /* Prevent exceeding screen width on small screens */

  @media screen and (min-width: 768px) {
    max-width: 30%; /* Adjust as needed for larger screens */
    margin-bottom: 0;
    border-radius: 10px 0 0 10px;
  }
`;

const TextContainer = styled.div`
  background-color: #f5f5f5; /* Lighter color for the second container */
  border-radius: 10px;
  padding: 20px;
  width: 100%; /* Full width for small screens */
  max-width: 100%; /* Prevent exceeding screen width on small screens */

  @media screen and (min-width: 768px) {
    max-width: 70%; /* Adjust as needed for larger screens */
    border-radius: 0 10px 10px 0;
  }
`;

const RoundedImage = styled.img`
  border-radius: 50%;
  width: 150px;
  height: 150px;
  object-fit: cover;
  margin-bottom: 20px;
`;

const NameTitle = styled.p`
  font-size: 20px;
  font-weight: bold;
  margin-bottom: 10px;
`;

const Home = () => {
  return (
    <PageContainer>
      <HomeContainer>
        <InfoContainer>
          <RoundedImage src={pic} alt="Cute Cat" />
          <NameTitle>Roxana Halati (like the city Galati but with H)</NameTitle>
          <p style={{ fontSize: '16px' }}>Assistant PhD</p>
          <p style={{ fontSize: '16px', marginBottom: '10px' }}>UBB FMI</p>
          <p style={{ fontSize: '14px', marginBottom: '5px' }}>Email: example@example.com</p>
        </InfoContainer>

        <TextContainer>
          <div>
            <p>
              Hi there! Thank you for visiting my website. Lorem Ipsum Dolor Sit Amet, consectetur adipiscing elit.
              Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud
              exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat.
            </p>
          </div>
        </TextContainer>
      </HomeContainer>
    </PageContainer>
  );
};

export default Home;
